import React from "react";

class Floors extends React.Component {
    constructor(props) {
        super(props);
        this.state = {
            floors:5
        };
    }

    componentDidMount = () => {
    };


    render() {
        var clientDetails;
        clientDetails = this.state.floors.map((item, i) => {
          return <InnerClient key={i} client={item} />;
        });

        return (
            <div className="floorsWrapper">
                {clientDetails}
            </div>
        );
    }
}

export default Floors;
